import React,{useState} from 'react'
import "./NavBar.css"

import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import VideoCallIcon from '@mui/icons-material/VideoCall';
import NotificationsIcon from '@mui/icons-material/Notifications';
import { Avatar } from '@mui/material';

export default function NavBar({Demo}) {
  let [Data,SetData]= useState("");
 
  return (
    <div id="Nav">

        <div id="First">
            <MenuIcon/>
            <img id = "YtLogo" src="YtLogo.svg" alt="YouTube" />
        </div>



        <div id="Second">

            <input type="text" placeholder='Search...' onChange={(e)=>{SetData(e.target.value)}}/>
            <SearchIcon id = "SearchIcn" onClick= {()=>{Demo(Data)}} />
            

        </div>


        <div id="Third">
        <VideoCallIcon className = "NavIcon"/>
        <NotificationsIcon className = "NavIcon"/>
        <Avatar className = "NavIcon">S</Avatar>

        </div>

    </div>
  )
}
